// using bootstrap to build a link to social channels
export default (props) => {
	let channels = [];
	for (let item in props.channelLink) {

		let temp = <a 
					href={props.channelLink[item]} 
					target="_blank" 
					className={props.classList || ""} 
					key={item}> 

					<i className={`fab fa-${item} fa-${props.size || "1"}x`}></i> 
					</a>;

		channels.push(temp);
	}

	return channels;
}
